function borrarAvances(avanceID){

    let avance;
    let ids = document.querySelectorAll(".ID")

    ids.forEach(function callback(currentValue, index, array){

        if (currentValue.innerHTML == avanceID){
            currentValue.parentElement.remove()
        }
    })

}
